import React from 'react';

import Link from 'next/link';

const NavLink=({href})=>{
  return(
    <Link href>
        <a>Sobre</a>
    </Link>
  );
}

const NavBar=()=>{
  return(
    <div className='bg-gray-500 py-4'>
      <NavLink href='/Sobre'/>
      <Link href='/Cadastro'>
        <a>Cadastre-se</a>
      </Link>
      <Link href='/Login'>
        <a>Entrar</a>
      </Link>
    </div>
  );
}

export default NavBar;
